import React, { useEffect, useState} from 'react'
import './style.css';
import axios from 'axios'

const api = axios.create({
    baseURL: 'https://pasd-webshop-api.onrender.com/api/order/'
})

export class Delivery extends Component{
    constructor() {
        super();
        api.get('/').then(res => {
            console.log(res.data)
        })
    }

}
